INSERT INTO `policies` VALUES (1,'2024-11-11 18:43:49.000000','2024-11-11 18:43:49.000000','Phí huỷ sẽ được tính dựa trên giá gốc, không giảm trừ bất kỳ khuyến mãi hay giảm giá nào và không vượt quá số tiền quý khách đã thanh toán. Nếu quý khách huỷ vé trước 2 ngày so với thời gian khởi hành, toàn bộ số tiền sẽ được hoàn lại 100%. Trong trường hợp huỷ trước 1 ngày, quý khách sẽ được hoàn 30% số tiền đã thanh toán. Tuy nhiên, nếu huỷ trong vòng chưa đầy 1 ngày trước thời gian khởi hành, nhà xe sẽ không hỗ trợ hoàn tiền.','Chính sách hủy vé',1,_binary '\0'),(2,'2024-11-11 18:43:49.000000','2024-11-11 18:43:49.000000','Có mặt tại văn phòng/quầy vé/bến xe trước 30 phút để làm thủ tục lên xe.\nXuất trình SMS/Email đặt vé trước khi lên xe.\nKhông mang đồ ăn, thức ăn có mùi lên xe.\nKhông hút thuốc, uống rượu, sử dụng chất kích thích trên xe.\nKhông mang các vật dễ cháy nổ lên xe.\nKhông vứt rác trên xe.\nKhông làm ồn, gây mất trật tự trên xe.\nKhông mang giày, dép trên xe.','Yêu cầu khi lên xe',1,_binary '\0'),(3,'2024-11-11 18:43:49.000000','2024-11-11 18:43:49.000000','Tổng trọng lượng hành lý không vượt quá 20 kg.\nKhông vận chuyển hàng hóa cồng kềnh.\nKhông hoàn tiền trong trường hợp huỷ đơn hàng do vi phạm các quy định về hành lý.','Hành lý xách tay',1,_binary '\0'),(4,'2024-11-11 18:43:49.000000','2024-11-11 18:43:49.000000','Phụ nữ có thai cần đảm bảo sức khỏe trong suốt quá trình di chuyển.\nNhà xe có quyền từ chối phục vụ nếu hành khách không tuân thủ quy định về trẻ em và phụ nữ có thai.\nTrẻ em dưới 6 tuổi được miễn phí vé nếu ngồi cùng ghế/giường với bố mẹ.\nTrẻ em từ 6 tuổi trở lên mua vé như người lớn.\nĐối với xe phòng đôi: Không áp dụng chính sách trẻ em, tối đa 2 người/phòng bất kể độ tuổi hoặc kích thước.','Trẻ em và phụ nữ có thai',1,_binary '\0'),(5,'2024-11-11 18:43:49.000000','2024-11-11 18:43:49.000000','Nhà xe không nhận chở động vật cảnh/thú cưng','Động vật cảnh/Thú cưng',1,_binary '\0'),(6,'2024-11-11 18:43:49.000000','2024-11-11 18:43:49.000000','Nhà xe có cung cấp hóa đơn GTGT cho dịch vụ xe khách, phí xuất hóa đơn là 8 % trên giá dịch vụ quý khách đã mua','Xuất hóa đơn GTGT',1,_binary '\0'),(7,'2024-11-11 18:43:49.000000','2024-11-11 18:43:49.000000','Quý khách vui lòng liên hệ tổng đài TicketGo để được hỗ trợ bảng giá cước gửi xe và xác nhận còn chỗ trống để gửi kèm xe (trong trường hợp nhà xe không còn hầm trống sẽ không hỗ trợ nhận gửi kèm xe đạp/xe máy)','Gửi xe đạp/xe máy',1,_binary '\0');
/*!40000 ALTER TABLE `policies` ENABLE KEYS */;
UNLOCK TABLES;

